import React from 'react';
import BLoggin from '../login/login.js';
import { useEffect, useState } from "react";
import Top from '../Top/Top.json';
import TopComponent from '../Top/TopComponent';
import './HomePage.css'
const Home = () => {
  const [authenticated, setauthenticated] = useState(null);
  useEffect(() => {
    const authenticated = localStorage.getItem("authenticated");
    const loggeduser = localStorage.getItem("user");
    console.log("User is " + authenticated);

    if (authenticated) {
      setauthenticated(authenticated);
    }
  }, []);
  if (authenticated == "true")
  {
    return (
        <div className='Top3'>
          <div class="box">
          <table class='center'>
            <tr>
              <th>  </th>
              <th> Rank </th>
              <th> Name</th>
              <th> Games</th>
              <th> Victories</th>
              <th> Winrate</th>
              <th> Status</th>
          </tr>
          <tr>
              <th>  <img src={Top[0].ProfilePic} height="35"/> </th>
              <th>  <img src={Top[0].TrophyPic} height="35"/> </th>
                <th> {Top[0].Rank}</th>
                <th> {Top[0].winrate}</th>
                <th>{Top[0].TotalGames}</th>
                <th>{Top[0].Victories}</th>
                <th>{Top[0].winrate}</th>
                <th>{Top[0].isActive}</th>
              {Top[0].isActive ? (
                 <th>Online </th>
              ) : (
              <th>Offline </th>
              )}

            </tr>
            <tr>
            <th>  <img src={Top[1].ProfilePic} height="35"/> </th>
              <th>  <img src={Top[1].TrophyPic} height="35"/> </th>
                <th> {Top[1].Rank}</th>
                <th> {Top[1].name}</th>
                <th>{Top[1].TotalGames}</th>
                <th>{Top[1].Victories}</th>
                <th>{Top[1].winrate}</th>
                <th>{Top[1].isActive}</th>
              {Top[1].isActive ? (
                 <th>Online </th>
              ) : (
              <th>Offline </th>
              )}

            </tr>
            <tr>
            <th>  <img src={Top[2].ProfilePic} height="35"/> </th>
              <th>  <img src={Top[2].TrophyPic} height="35"/> </th>
                <th> {Top[2].name}</th>
                <th>{Top[2].TotalGames}</th>
                <th>{Top[2].Victories}</th>
                <th>{Top[2].winrate}</th>
                <th>{Top[2].isActive}</th>
              {Top[2].isActive ? (
                 <th>Online </th>
              ) : (
              <th>Offline </th>
              )}

            </tr>

            </table>
            </div>
        </div>
    );
  }
  else
  {
  return (
    <div className='HomePage'>
      <h1></h1>
      <BLoggin/>
    </div>
  );
};
}

export default Home;
